from .database import DatabaseConnection


class ConfigInformations:
    def __init__(self):
        self.language = ""
        self.current_version = ""
        self.NUM_KEYS = [
            "logger_id",
            "sensor_id",
            "server_port",
            "post_time_ms",
            "temperature",
            "humidity",
            "pressure",
            "sht",
            "clock",
            "set_time",
            "logging_enabled",
            "wifi_enabled",
        ]
        self.STR_KEYS = [
            "server_ip",
            "wifi_ssid",
            "wifi_password",
        ]
        self.ALL_KEYS_ORDER = [
            "logger_id",
            "sensor_id",
            "server_ip",
            "server_port",
            "post_time_ms",
            "temperature",
            "humidity",
            "pressure",
            "sht",
            "clock",
            "set_time",
            "logging_enabled",
            "wifi_enabled",
            "wifi_ssid",
            "wifi_password",
        ]
        self.icon_path = """"""

    def get_current_version(self):
        conn = DatabaseConnection(
            "SELECT value FROM config_data WHERE parameter='version'"
        )
        self.current_version = conn.get_one_data()
        return self.current_version

    def get_language(self):
        conn = DatabaseConnection(
            "SELECT value FROM config_data WHERE parameter='language'"
        )
        print(conn.get_one_data())
        self.language = conn.get_one_data()
        return self.language

    def set_language(self, language):
        update_statement = "UPDATE config_data SET value = ? WHERE parameter = ?"
        conn = DatabaseConnection(update_statement, (language, "language"))
        conn.update_data()
        self.language = language

    def get_icon_path(self):
        return self.icon_path

    def get_str_keys(self):
        return self.STR_KEYS

    def get_num_keys(self):
        return self.NUM_KEYS

    def get_all_keys(self):
        return self.ALL_KEYS_ORDER
